import React, { useState } from 'react';
import '@fortawesome/fontawesome-free/css/all.min.css';
import { Modal, Button, Form } from 'react-bootstrap';
import { GoogleLogin } from '@react-oauth/google';

function Login({ show, handleClose }) {
  const [role, setRole] = useState('');
  const [isVolunteer, setIsVolunteer] = useState(false);

  const handleSuccess = (response) => {
    console.log('Login Success:', response);
    // Handle successful login (e.g., redirect to dashboard or save user info)
  };

  const handleFailure = (error) => {
    console.log('Login Failed:', error);
    // Handle login failure
  };

  return (
    <Modal show={show} onHide={handleClose} centered className="login-modal">
      <Modal.Header closeButton>
        <Modal.Title>Login</Modal.Title>
      </Modal.Header>
      <Modal.Body>
        <form>
          <div className="text-center mb-3">
            <p>Sign in with:</p>

            <button type="button" className="btn btn-link btn-floating mx-1">
              <GoogleLogin 
                onSuccess={handleSuccess} 
                onFailure={handleFailure}
                style={{ fontSize: '24px' }}
              />
              <i className="fab fa-google"></i>
            </button>
          </div>
          <p className="text-center">or:</p>
          <div className="form-outline mb-4">
            <input type="email" id="loginName" className="form-control" />
            <label className="form-label" htmlFor="loginName">Email or username</label>
          </div>
          <div className="form-outline mb-4">
            <input type="password" id="loginPassword" className="form-control" />
            <label className="form-label" htmlFor="loginPassword">Password</label>
          </div>
          <div className="mb-4">
            <Form.Group controlId="roleSelect">
              <Form.Label>Select your role</Form.Label>
              <Form.Control as="select" value={role} onChange={(e) => setRole(e.target.value)}>
                <option value="">Select a role</option>
                <option value="faculty">Faculty</option>
                <option value="event-manager">Event Manager</option>
                <option value="student">Student</option>
              </Form.Control>
            </Form.Group>
          </div>
          {role === 'student' && (
            <div className="mb-4">
              <Form.Group controlId="volunteerCheck">
                <Form.Check 
                  type="checkbox"
                  label="Are you a volunteer?"
                  checked={isVolunteer}
                  onChange={(e) => setIsVolunteer(e.target.checked)}
                />
              </Form.Group>
            </div>
          )}
          <div className="row mb-4">
            <div className="col-md-6 d-flex justify-content-center">
              <div className="form-check mb-3 mb-md-0">
                <input className="form-check-input" type="checkbox" value="" id="loginCheck" defaultChecked />
                <label className="form-check-label" htmlFor="loginCheck"> Remember me </label>
              </div>
            </div>
            <div className="col-md-6 d-flex justify-content-center">
              <a href="#!">Forgot password?</a>
            </div>
          </div>
          <Button type="submit" className="btn btn-primary btn-block mb-4">Sign in</Button>
          <div className="text-center">
            <p>Not a member? <a href="#!">Register</a></p>
          </div>
        </form>
      </Modal.Body>
    </Modal>
  );
}

export default Login;
